import { isLogIn } from "./fetch"
import PostForm from "./PostForm"

const Home = () => {
    const loggedIn = isLogIn()
    return (
        <div>
            <a href="/login">login</a>
            <a href="/register">register</a>
           {loggedIn && <PostForm/>}
        </div>
    )
}
export default Home
